.Replace("\r", "").Split("\n");
int lineLength = input[0].Length;
int numberOflines = input.Length;
char[] characters = ['X', 'M', 'A', 'S'];
int output = 0;

char[,] matrix = new char[numberOflines, lineLength];
for (int i = 0; i < input.Length; i++)
{
    string line = input[i];
    for (int j = 0; j < line.Length; j++)
    {
        matrix[i, j] = line[j];
    }
}

for (int i = 0; i < numberOflines; i++)
{
    for (int j = 0; j < lineLength; j++)
    {
        if (matrix[i, j] == characters[0])
        {
            int characterIndex = 0;
            List<Vector2> directions = radar(characterIndex, i, j);
            foreach (var direction in directions)
            {
                characterIndex = 0;
                int nextX = i;
                int nextY = j;
                while (true)
                {
                    characterIndex++;
                    if (characterIndex == characters.Length)
                    {
                        output++;
                        break;
                    }
                    nextX += direction.X;
                    nextY += direction.Y;
                    if (!checkCharacter(characterIndex, nextX, nextY))
                    {
                        break;
                    }
                }

            }
        }
    }
}
Console.WriteLine(output);


bool checkCharacter(int characterIndex, int x, int y)
{

    bool InRange = true;
    if (x < 0 || x > numberOflines - 1)
    {
        InRange = false;
    }
    if (y < 0 || y > lineLength - 1)
    {
        InRange = false;
    }
    if (InRange && matrix[x, y] == characters[characterIndex])
    {
        return true;
    }
    return false;
}

//x=line, y=column
List<Vector2> radar(int characterIndex, int x, int y)
{
    char nextChar = characters[characterIndex + 1];
    List<Vector2> vectorsToReturn = new List<Vector2>();

    if (x != 0)
    {
        if (y != 0)
        {
            if (matrix[x - 1, y - 1] == nextChar)
            {
                vectorsToReturn.Add(new Vector2(-1, -1));
            }
        }
        if (matrix[x - 1, y] == nextChar)
        {
            vectorsToReturn.Add(new Vector2(-1, 0));
        }
        if (y != lineLength - 1)
        {
            if (matrix[x - 1, y + 1] == nextChar)
            {
                vectorsToReturn.Add(new Vector2(-1, 1));
            }
        }
    }

    if (y != 0 && matrix[x, y - 1] == nextChar)
    {
        vectorsToReturn.Add(new Vector2(0, -1));
    }
    if (y != lineLength - 1 && matrix[x, y + 1] == nextChar)
    {
        vectorsToReturn.Add(new Vector2(0, +1));
    }

    if (x != numberOflines - 1)
    {
        if (y != 0)
        {
            if (matrix[x + 1, y - 1] == nextChar)
            {
                vectorsToReturn.Add(new Vector2(1, -1));
            }
        }
        if (matrix[x + 1, y] == nextChar)
        {
            vectorsToReturn.Add(new Vector2(1, 0));
        }
        if (y != lineLength - 1)
        {
            if (matrix[x + 1, y + 1] == nextChar)
            {
                vectorsToReturn.Add(new Vector2(1, 1));
            }
        }
    }

    return vectorsToReturn;
};





public class Vector2
{
    public int X { get; set; }
    public int Y { get; set; }

    public Vector2(int x, int y)
    {
        X = x;
        Y = y;
    }

    public override string ToString()
    {
        return $"Vector2(X: {X}, Y: {Y})";
    }
}

